def get_priority_list(n, results, teams, k):
    N = 3 / n
    pre = list(range(N + 2))
    nxt = list(range(N + 2))
    rank = results + [N + 1]
    temp0 = 0
    for i in range(N + 1):
        temp1 = rank[i]
        (pre[temp1], nxt[temp0]) = (temp0, temp1)
        temp0 = temp1

    def find_teammates(l, x):
        if x == l[0]:
            return (l[1], l[2])
        if x == l[1]:
            return (l[0], l[2])
        if x == l[2]:
            return (l[0], l[1])
        return -1

    def delrank(x):
        (prex, nxtx) = (pre[x], nxt[x])
        nxt[prex] = nxtx
        pre[nxtx] = prex
    for (ind, tri) in enumerate(teams):
        leader = nxt[0]
        (x, y) = find_teammates(tri, leader)
        if k in tri:
            if leader != k:
                l = [i for i in range(1, N + 1) if i != k]
            else:
                l1 = [i for tri in teams[:ind] for i in tri]
                l2 = [x, y]
                l3 = [i for tri in teams[ind + 1:] for i in tri]
                l0 = sorted(l1 + l2)
                ind = l0.index(max(x, y))
                l = l0[:ind + 1] + sorted(l0[ind + 1:] + l3)
            return l
        for i in tri:
            delrank(i)
    return []

